import React from "react";
import ProductList from "../Components/ProductList"
import ProductSlide from "../Components/ProductSlide";
import dummySool from "./static/dummyData";

import './Home.css'

const Home = () => {
    return (
        <>
            <section>
                <ProductSlide />
            </section>
            <section className="product__list-container">
                <ProductList />
            </section>
        </>
    )
}

export default Home
